import React, { Component } from 'react';
import logo from './logo.png';
import './App.css';
import HangManService from './components/hangmanService';

class App extends Component {


  constructor(props) {
	    super(props);
	    this.hangManService = new HangManService();
	    this.state = {
	      elements:null,
	      errorMessage:null
	    }
  }



  async componentDidMount() {
	   this.hangManService.newGame().then(response => {
		   alert(response.errorMessage);
	          this.setState({elements: response.numCharacter, errorMessage:response.message});
	        }
	    );
  }

  render() {
    const {elements,errorMessage} =this.state;

    let rows = []
    for(let i=0; i<elements; i++){
      rows.push(' __ ')
    }

    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <div className="App-intro">
	          <br/>
	          <br/>
	            {rows}
	          <br/>
	          <br/>
	          {errorMessage}
          </div>
        </header>
      </div>
    );
  }
}

export default App;
